import React from "react";
import {Layout} from 'antd';
import AppHeader from "../components/AppHeader";

export default class index extends React.Component{
    constructor(props){
        super(props)
    }

    render() {
        return (
            <Layout>
                <div  className="layout">

                </div>
                <AppHeader/>

                <style jsx global>{`
                    .layout{
                        position:fixed;
                        left:19px;
                        bottom:10px;
                        z-Index: 20;
                    }  
                `}
                </style>
            </Layout>
        );
    }
}
